import { putFestival } from './services/travelagentServices/festivalService';


function App() {
  const fetchFestivals = async() => {
    try{
      const response = await putFestival(JSON.stringify({
        festivalName: "adf",
        festivalDescription: "adf",
        festivalMonth: "adfd"
      }), 'FESID9114');
      console.log(response)
    }
    catch(error){
      console.log(error)
    }
  }
  return (
    <div className="App">
      <button onClick={fetchFestivals}>get</button>
    </div>
  );
}

export default App;
